// Import React and necessary components from react-router-dom
import React from "react";
import { Route, BrowserRouter, Routes } from "react-router-dom";
import Header from "../src/Componets/Header";
import "./App.css";
// Directly import the HomePage component
import HomePage from "./Pages/HomePage";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header
          isAuth={''}
          userCredits={''}
          setIsAuth={''}
        />

        {/* Simple routing without Suspense and React.lazy */}
        <Routes>
          <Route path="/HomePage" element={<HomePage />} />
          {/* Optionally, you can have the HomePage as your landing page by setting the path to "/" */}
          {/* <Route path="/" element={<HomePage />} /> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
